import 'bootstrap/dist/css/bootstrap.min.css';
import { Button, Nav, Container, Navbar, NavDropdown } from 'react-bootstrap';
import './App.css';


function App() {
  return (
    <header>
    <Nav defaultActiveKey="/home" className="flex-column">
      <Nav.Link href="/home">Main</Nav.Link>
      <Nav.Link eventKey="link-1">Search</Nav.Link>
      <Nav.Link eventKey="link-2">Site1</Nav.Link>
      <Nav.Link eventKey="link-3">Site2</Nav.Link>
      <Nav.Link eventKey="link-4">Site3</Nav.Link>
      <Nav.Link eventKey="link-5">Site4</Nav.Link>

    </Nav>
    </header>

  );
}

export default App;
